'use strict';

//Include
var dataCollector = require('./dataCollector');

exports.insertTmpTableToRealMNTable = function (context, asyncDone) {
	var dbSeg = context.oData.dbSegmentLast;

	return dataCollector.execParallelNoResultwithParam([dbSeg.sql.stmContainer.insertReal], context,
		dataCollector.getAffectedRowsValidator(1, asyncDone),
		/**
		 * true ->  provide affectedRows parameter.
		 */
		true  );
};
